package web.com.springweb.project.p04_vo;

import java.util.Date;

public class Enrollments {
	private int enrId;
	private int memPrid;
	private int materialsId;
	private String status;
	private Date enrDate;
	public Enrollments() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Enrollments(int enrId, int memPrid, int materialsId, String status, Date enrDate) {
		super();
		this.enrId = enrId;
		this.memPrid = memPrid;
		this.materialsId = materialsId;
		this.status = status;
		this.enrDate = enrDate;
	}
	public int getEnrId() {
		return enrId;
	}
	public void setEnrId(int enrId) {
		this.enrId = enrId;
	}
	public int getMemPrid() {
		return memPrid;
	}
	public void setMemPrid(int memPrid) {
		this.memPrid = memPrid;
	}
	public int getMaterialsId() {
		return materialsId;
	}
	public void setMaterialsId(int materialsId) {
		this.materialsId = materialsId;
	}
	public String getStatus() {
		return status;
	}
	public void setStatus(String status) {
		this.status = status;
	}
	public Date getEnrDate() {
		return enrDate;
	}
	public void setEnrDate(Date enrDate) {
		this.enrDate = enrDate;
	}
	
}
